Wing
. Clear. Tegula mostly black, basicosta yellow. Crossvein r-m placed slightly apicad of the point where vein R1 enters costa; dm-cu curved (
♂
) or sinuous (
♀
), longer than apical section of vein CuA1. Vein M running straight to wing-margin. Calypters white, margins creamy. Knob of haltere orange, partly darkened.

Ƌ terminalia
. Epandrium separated from tergite 5 by syntergosternite 8, which has 2 spiracles; with a long process at antero-ventral corner, ventrad of the lobe that connects with the hypandrium and is directed forwards (
Fig. 339
). Tergite 6 absent. Sternite 6 small, subquadrate, withdrawn beneath sternite 5 and connected to it by two triangular plates. Surstylus absent, i.e. fused to epandrium without trace (
Fig. 339
). Cercal plate deeply divided dorsally (
Fig. 340
). Hypandrium attached at two points: to a rod originating from wall of epandrium close to upper outer edge of cercal plate; and via an apparent praegonite to lower anterior corner of epandrium. Phallic complex (
Fig. 341
): hypandrium branching posteriorly, the upper pair of branches meeting behind base of phallus; praegonite and postgonite present, the latter very short; phallapodeme long but normal in structure, at mid-length connected to hypandrium by a bridge; phallus long, tubular, simple, juxta large, without spinules; basal part consisting of a multi-toothed process.
